 const {userList} =props
 const [dat, setdatax] = useState([]);

while(typeof userList != "undefined"){
    setdatax = userList.map((item, index)=>{
        return <li key={item.id}> {item.title}</li>
 })}


return(
    
    <div>
        <h1>pagina: {props.currentPage}</h1>
        <button onClick={props.nexthandle}>next</button>
        <button onClick={props.prevhandle}>prev</button>

        <h2>items</h2>
        <ul>
         {dat}
        </ul>
    </div>
)
}

export default Getlist
